import React from 'react';
import './Main.css'

const Main = () => {
    return (
        <div className='main_container'> 
            <div className='main_container_adp'> 
           <div className="main_container_info">
            <p className='main_name'>Унікальне ТП</p>
            <p className='main_text'></p>
           </div>
           </div>
        </div>
    );
};

export default Main;
